import BondingBonfire from './pages/BondingBonfire';
import Firey from './pages/Firey';
import ThisIsanother from './pages/thisIsanother';
import Thisisanotheranotheranotherfile from './pages/thisisanotheranotheranotherfile';
import Wowthisisanotherone from './pages/wowthisisanotherone';
import Slkafjdlksaj from './pages/slkafjdlksaj';
import Thisisanewdoccod from './pages/thisisanewdoccod';
import Rappy from './pages/rappy';
import Productivity from './pages/productivity';
import About from './pages/about';
import Contact from './pages/contact';
import Home from './pages/Home';
import {Routes as Routes} from 'react-router-dom';
import {Route as Route} from 'react-router-dom';
import {useState} from 'react';
import axios from 'axios';
import {Link} from 'react-router-dom';
import './App.css'

function App(){
  const [stvar, setMess] = useState('');
  const [tfvar, setTF] = useState(true);
  const [tfvarhome, setTFHome] = useState(false);
  const handleClick = (paramm) => {
    axios.post('http://localhost:8080/helphealth123',paramm)
    .then(response => setMess(response.data))
    setTF(tfvar=>!tfvar);
    setTFHome(tfvarhome => !tfvarhome);
  }
  const homeClick = () => {
    setTF(tfvar=>!tfvar);
    setTFHome(tfvarhome => !tfvarhome);
  }
  const linksData = [
    { id: 1, text: 'About', to: '/about' },
    { id: 2, text: 'Contact', to: '/contact' },
    { id: 3, text: 'Productivity', to: '/productivity' },
    { id: 4, text: 'Rappy', to: '/rappy' },
    { id: 5, text: 'Thisisanewdoccod', to: '/thisisanewdoccod' },
    { id: 6, text: 'Slkafjdlksaj', to: '/slkafjdlksaj' },
    { id: 7, text: 'Wowthisisanotherone', to: '/wowthisisanotherone' },
    { id: 8, text: 'Thisisanotheranotheranotherfile', to: '/thisisanotheranotheranotherfile' },
    { id: 9, text: 'ThisIsanother', to: '/thisIsanother' },
    { id: 10, text: 'Firey', to: '/Firey' },
    { id: 11, text: 'BondingBonfire', to: '/BondingBonfire' },
    ];
  return (
    <div>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About name = {stvar}/>} />
        <Route path="/contact" element={<Contact name = {stvar}/>} />
        <Route path="/productivity" element={<Productivity name = {stvar}/>} />
        <Route path="/rappy" element={<Rappy name = {stvar}/>} />
        <Route path="/thisisanewdoccod" element={<Thisisanewdoccod name = {stvar}/>} />
        <Route path="/slkafjdlksaj" element={<Slkafjdlksaj name = {stvar}/>} />
        <Route path="/wowthisisanotherone" element={<Wowthisisanotherone name = {stvar}/>} />
        <Route path="/thisisanotheranotheranotherfile" element={<Thisisanotheranotheranotherfile name = {stvar}/>} />
        <Route path="/thisIsanother" element={<ThisIsanother name = {stvar}/>} />
        <Route path="/Firey" element={<Firey name = {stvar}/>} />
        <Route path="/BondingBonfire" element={<BondingBonfire name = {stvar}/>} />
      </Routes>
      <nav>
        <ul style={{listStyleType: 'none'}}>
              {tfvarhome && <li>
                <Link to='/' onClick={homeClick} class="top-right-div">Home</Link>
              </li>}
              {linksData.map((link) => (
              <li key={link.id}>
                  {tfvar &&<Link to={link.to} onClick = {()=>handleClick(link.to)}>{link.text}</Link>}
              </li>
              ))}
        </ul>
      </nav>
    </div>
  );
}

export default App
